var UiObjectBase = require("./ui_object_base.js");
var UiObjectBaseTO = UiObjectBase.UiObjectBaseTO;
var UiObjectBaseDescription = UiObjectBase.UiObjectBaseDescription;

/**
 * The description of a UIAPro edit field test object.
 * @param {Object} [props] Initializes a UIAPro Edit test object using the supplied property bag.
 * @returns {Edit} the description object that was initialized.
 * @class Edit
 * @extends UIAPro.UiObjectBaseDescription
 * @mixes UIAPro.FieldDescriptionBehavior
 * @memberof UIAPro
 */
function Edit(props) {
    var editDesc = new UiObjectBaseDescription("Edit");

    editDesc._defineByPropertyBag(props);
    return editDesc;
}

/**
 * A UIAPro edit field.
 * @constructor
 * @class EditTO
 * @extends UIAPro.UiObjectBaseTO
 * @memberof UIAPro
 */
function EditTO(session, description) {
    description = description || Edit();
    var editTO = new UiObjectBaseTO("UIAProEdit", session, description);
    
    return editTO;
}


module.exports.EditTO = EditTO;
module.exports.Edit = Edit;